import React, { useState } from 'react';

const files = [
	{
		name: 'package.json',
		content: `{
  "scripts": {
    "start": "react-scripts start"
  },
  "proxy": "http://localhost:8080",
  "dependencies": {
    "axios": "^0.27.2",
    "react": "^18.2.0",
    "react-dom": "^18.2.0",
    "react-scripts": "5.0.1"
  },
  "browserslist": {
    "production": [
      ">0.2%",
      "not dead",
      "not op_mini all"
    ],
    "development": [
      "last 1 chrome version",
      "last 1 firefox version",
      "last 1 safari version"
    ]
  }
}`
	},
	{
		name: 'index.js',
		content: `import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);`
	}
];

function App() {
	const [mode, setMode] = useState(null);
	const [selectedFile, setSelectedFile] = useState(null);

	const handleModeChange = (newMode) => {
		setMode(newMode);
		setSelectedFile(null);
	};

	return (
		<div style={{ padding: '20px' }}>
      {/* Mode selection */}
			{!mode ? (
				<div>
					<button onClick={() => handleModeChange('learning')}>Learning</button>
					<button onClick={() => handleModeChange('testing')}>Testing</button>
				</div>
			) : (
				<div>
					<h2>{mode.charAt(0).toUpperCase() + mode.slice(1)} Mode</h2>
          {/* File buttons */}
					<div>
						{files.map((file, idx) => (
							<button key={idx} onClick={() => setSelectedFile(file)}>
								{file.name}
							</button>
						))}
					</div>
					{selectedFile && (
						<div style={{ marginTop: '20px' }}>
							<h3>{selectedFile.name}</h3>
							<pre style={{ background: '#f4f4f4', padding: '10px' }}>
								{selectedFile.content}
							</pre>
              {/* Display a dummy test result in Testing mode */}
							{mode === 'testing' && (
								<div style={{ marginTop: '10px', color: 'green' }}>
									Test passed!
								</div>
							)}
						</div>
					)}
				</div>
			)}
		</div>
	);
}

export default App;
